    background-color: #c30d23;
    position: absolute;
    width: 100%;
    height: 100%;
    left: 0;
    top: 0;
    transform-origin: center center;
    transition: all 5s ease-in-out;
    display: flex;
    align-items: center;
    justify-content: flex-end;
    opacity: 0;
    z-index: 10;

    .mosaic-box {
      width: 30vw;
      height: 100%;
    }

    .info {
      //height: 40%;
      padding-top: 1vw;
      padding-right: 2vw;
      z-index: 1;
      svg {
        width:calc(600 * 100vw / 1920);
        .cls-1 {
          fill: #fff;
        }
        .cls-2,
        .cls-3 {
          fill: none;
          stroke: #fff;
          stroke-miterlimit: 10;
        }
        .cls-2 {
          stroke-width: 0;
        }
        .cls-4 {
          fill: #e50027;
        }
      }
    }
    .logo {
      padding-right: 2vw;
      z-index: 10;
      svg {
        width:calc(300 * 100vw / 1920);
        .cls-1 {
          fill: #fff;
        }
      }
    }

    .fix-bar {
      background: rgba(231, 149, 14);
      background: linear-gradient(
        90deg,
        rgba(231, 149, 14, 0.8) 0%,
        rgba(195, 13, 35, 0.8) 100%
      );
      position: absolute;
      transition: all 0.5s;
      transform-origin: center;
      transform: scaleX(1);
      animation: animate 10s infinite;

      &.fix-bar-1 {
        width: 15%;
        height: 8%;
        right: 13vw;
        top: 10%;
        animation-delay: random(5) + s;
      }

      &.fix-bar-2 {
        width: 15%;
        height: 8%;
        left: 32vw;
        top:calc(53% + 6.5vw);
        animation-delay: random(5) + s;
      }

      @keyframes animate {
        0% {
          transform: scaleX(1);
        }
        50% {
          transform: scaleX(1.5);
        }
        100% {
          transform: scaleX(1);
        }
      }
    }

    .leftbottom {
      width: 30px;
      position: absolute;
      left: 3vw;
      bottom: 0;
    }
    .float-btn {
      position: fixed;
      z-index: 15;
      right: 3vw;
      bottom: 5vw;
      width: 80px;
      height: 80px;
      color: #c30d23;
      background: #fff;
      display: flex;
      align-items: center;
      justify-content: center;
      border-radius: 100%;
      font-size: 24px;
      line-height: 1.2;
      box-shadow: 4px 8px 10px #641522;
      transition: all 0.5s;

      &:hover {
        transform: translate(4px, 8px);
        box-shadow: 1px 1px 1px #641522;
        cursor: pointer;
        background-color: #c44e5c;
        color: #fff;
      }
    }

    &.active {
      opacity: 1;
    }
  }
}
